export default function JsonInputDisplay() {
  const [jsonData, setJsonData] = useState([]);

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        try {
          // JSONファイルの内容をテキストとして取得し、JSON.parseでオブジェクトに変換
          const parsedData = JSON.parse(e.target.result);
          setJsonData([...jsonData, ...parsedData]);
        } catch (error) {
          console.error('JSONファイルの解析に失敗しました:', error);
          setJsonData(null); // エラー時はnullをセット
        }
      };
      reader.readAsText(file); // ファイルをテキストとして読み込む
    }
  };

  const playerData =
    jsonData.forEach((pitem) => {
      const findData = musicData.find((mitem) => {
        return mitem.title === pitem.title && mitem.diff === pitem.diff;
      });
      if (findData) {
        pitem['genre'] = findData.genre;
        pitem['version'] = findData.version;
        pitem['level'] = findData.level;
        pitem['const'] = findData.const;
      }
    }) || [];

  const rows = playerData.map((item, index) => ({
    id: index + 1,
    title: item.title,
    difficulty: item.diff,
    level: Number.isInteger(item.level) ? String(item.level) : String(item.level).slice(0, 2) + '+',
    const: item.const,
    stdx: item.stdx,
    version: !item.version
      ? 'maimai'
      : item.version == 'PLUS'
      ? 'maimai PLUS'
      : item.version == 'でらっくす' || item.version == 'でらっくす PLUS'
      ? item.version
      : item.version.includes('でらっくす')
      ? item.version.slice(6)
      : item.version,
    score: Math.round(item.score * 10000),
    lamp: item.lamp,
    genre: item.genre
  }));

  return (
    <div>
      <input type="file" accept="application/json" onChange={handleFileChange} />
      {jsonData && (
        <div style={{ height: 600, width: '100%' }}>
          <DataGrid rows={rows} columns={columns} pageSize={10} rowsPerPageOptions={[10]} />
        </div>
      )}
    </div>
  );
}
